import React from "react";

function Box({id, handleRemove, Width = 100, Height = 100, BackgroundColor = "red"}) {
  const remove = () => handleRemove(id);
  return (
    <div>
      <div 
        style={{
        BackgroundColor,
        Height: `${Height}px`,
        Width: `${Width}px`
      }}
      />
        <button onClick={remove}>Delete Box</button>
    </div>
  );
}

export default Box;
